import React from 'react'
 import  QuoteList from '../components/quotes/QuoteList'
 const Dummy_Quotes=[
 {id:'q1',Author:'Aafiya', text:'Learning React is Fun!'},
 {id:'q2',Author:'Max', text:'Learning Javascript is Fun!'}
 
 ]

function AllQuotes() {
  return (
   <QuoteList quotes={Dummy_Quotes}/>
  )
}

export default AllQuotes
